        super(props);
    }

    render() {
        return (
            <div>
                <h3 style={{marginTop: '20px'}}>Obtenha sua localização</h3>
                <span>Permita acesso no seu navegador.</span>
                <br />
            </div>
        );
    }
}

export default Geolocalizacao;
